description:
These are unique remixes and 'hybrid' mixes I have made myself.
The music is from great classic rock bands including Pink Floyd, Boston, Queen, Rush, Van Halen, Alan Parsons Project, Berlin. 
Some mixes are better than others. Hope you enjoy my 'labor of love'

